import React from 'react'

const navbtn = (data) => {
    return (
        <button className="px-3 py-2 mx-5 my-2 rounded hover:bg-gray-200 focus:outline-none">{data.text}</button>
    )

}

const AppBar = () => {

  return (
    <div className="w-max bg-white ">
      {(
        <navbtn />
      )}
    </div>
  )
}

export default AppBar;
